import styles from './github_link.module.scss';



export default function GithubLink(): JSX.Element {
    return (
        <div className={styles.row} >
            <div className={styles.outerBox}>
            <div><a href="https://github.com/angyuhang98/fhir-theranos" target="_blank">
                <div>
                <img src={"./icons/github-black.svg"} className={styles.innerBox}></img>
           
                </div>
                
                </a>
                </div>

            </div>
            
                </div>

    );

}
